import React, { Component } from 'react';
import {table} from "antd"

class Record extends Component {
  render() {
    return (
      <div >
        <h2>Records</h2>
        <table className="table table-bordered">
          <tr>
            <th>Date</th>
            <th>Ttile</th>
            <th>Amount</th>


          </tr>

    </table>


      </div>
    );
  }
}

export default Record;
